import React, { Component} from 'react'
import axios from 'axios'


class Form extends Component {

state = {
    formState: ""
}
componentDidMount(){
axios.get("https://jsonplaceholder.typicode.com/posts")
.then((response)=>{
    this.setState({
        formState: response
    }, ()=>{
        console.log(this.state.formState)
    })
})
.catch((e)=>{
    console.log(e)
})

}


render() {
    return (
        <div>
           <h1> Form Page</h1>
           <p> intro to axios</p>
           <h1> {this.state.formState}</h1>
        </div>
    )
}
}
export default Form
